pragma solidity ^0.4.20;

// accounts
// payments
// 

// This is just a simple example of a coin-like contract.
// It is not standards compatible and cannot be expected to talk to other
// coin/token contracts. If you want to create a standards-compliant
// token, see: https://github.com/ConsenSys/Tokens. Cheers!

contract MOFService {
    address public mofAddress;


    uint256 constant private MAX_UINT256 = 2**256 - 1;
    mapping (address => uint256) public balances;
    mapping (address => mapping (address => uint256)) public allowed;


/*
    NOTE:
    The following variables are OPTIONAL vanities. One does not have to include them.
    They allow one to customise the token contract & in no way influences the core functionality.
    Some wallets/interfaces might not even bother to look at this information.
    */
    string public name;                   //fancy name: eg Simon Bucks
    uint8 public decimals;                //How many decimals to show.
    string public symbol;                 //An identifier: eg SBX


    // these are the list of available services
    mapping (bytes32=>address) public services;

    // accounts that are permitted to print more cash
    mapping (address=>bool) private authorisedAccounts;

    constructor() public {
        mofAddress = tx.origin;        
        name = "MOF Internal Currency";
        symbol = "MOF";
        decimals = 2;

    }

    modifier onlyOwner {
        require(msg.sender == mofAddress);
        _;
    }

    modifier onlyAuthorised {
        require(authorisedAccounts[msg.sender]);
        _;
    }

    // authorised accounts work on behalf of the owner. we don't use owner accounts, only authorised accounts
    // compromised authorised accounts can be removed by the owner
    function registerAuthorisedAccounts (address[10] accounts ) public onlyOwner {
        uint8 idx = 0;
        while (accounts[idx] != address(0) && idx < 10) {
            if (authorisedAccounts[accounts[idx]]) {
                authorisedAccounts[accounts[idx]] = true;
            }
            idx ++;
        } 
    }

    function registerAuthorisedAccount (address account ) public onlyOwner {
        authorisedAccounts[account] = true;
    }

    function unauthorise(address account) public onlyOwner {
        delete authorisedAccounts[account];
    }

    function registerService(address add, bytes32 n) public onlyAuthorised {
        services[n] = add;
    }

    // NOTE: for demo purpose we allow any user to mint
    // in reality we should limit by only authorised users
    // problem is; if we do that we need a service running that will
    // be triggered to mint
    // we don't have such a service
    function mintForUser(address user, uint amount) public {
        require(amount > 0);
        balances[user] += amount;
    }

    function getServiceAddress(bytes32 n) public view returns(address) {
        return services[n];
    }

    function payService(bytes32 n, uint16 amount) public {
        require(balances[msg.sender] >= amount);
        require(services[n] > 0);

        balances[msg.sender] -= amount;
        balances[services[n]] += amount;
        emit Transfer(msg.sender, services[n], amount);
    }

    event Transfer(address indexed _from, address indexed _to, uint256 _value);
    event Approval(address indexed _owner, address indexed _spender, uint256 _value);

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balances[msg.sender] >= _value);
        balances[msg.sender] -= _value;
        balances[_to] += _value;
        emit Transfer(msg.sender, _to, _value); //solhint-disable-line indent, no-unused-vars
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        uint256 allowance = allowed[_from][msg.sender];
        require(balances[_from] >= _value && allowance >= _value);
        balances[_to] += _value;
        balances[_from] -= _value;
        if (allowance < MAX_UINT256) {
            allowed[_from][msg.sender] -= _value;
        }
        emit Transfer(_from, _to, _value); //solhint-disable-line indent, no-unused-vars
        return true;
    }

    function balanceOf(address _owner) public view returns (uint256 balance) {
        return balances[_owner];
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowed[msg.sender][_spender] = _value;
        emit Approval(msg.sender, _spender, _value); //solhint-disable-line indent, no-unused-vars
        return true;
    }

    function allowance(address _owner, address _spender) public view returns (uint256 remaining) {
        return allowed[_owner][_spender];
    }
}
